CREATE DATABASE COFFEE_SHOP_INVENTORY;
USE COFFEE_SHOP_INVENTORY;

 
CREATE TABLE orders (
    row_id INT PRIMARY KEY,
    order_id VARCHAR(10),
    created_at DATETIME,
    item_id VARCHAR(10),
    quantity INT,
    cust_name VARCHAR(100),
    in_or_out VARCHAR(10)
);



-- items 
CREATE TABLE items (
    item_id VARCHAR(10) PRIMARY KEY,
    sku VARCHAR(20),
    item_name VARCHAR(100),
    item_cat VARCHAR(50),
    item_size VARCHAR(20),
    item_price DECIMAL(5,2)
);



-- recipies
CREATE TABLE recipe (
    row_id INT PRIMARY KEY,
    recipe_id VARCHAR(20),
    ing_id VARCHAR(10),
    quantity INT
);


-- ingredients
CREATE TABLE ingredients (
    ing_id VARCHAR(10) PRIMARY KEY,
    ing_name VARCHAR(100),
    ing_weight INT,
    ing_meas VARCHAR(10),
    ing_price DECIMAL(6,2)
);


-- inventory
CREATE TABLE inventory (
    inv_id VARCHAR(10) PRIMARY KEY,
    ing_id VARCHAR(10),
    quantity INT
);


-- staff
CREATE TABLE staff (
    staff_id VARCHAR(10) PRIMARY KEY,
    first_name VARCHAR(50),
    last_name VARCHAR(50),
    position VARCHAR(50),
    sal_per_hour DECIMAL(5,2)
);


-- shift
CREATE TABLE shift (
    shift_id VARCHAR(10) PRIMARY KEY,
    day_of_week VARCHAR(15),
    start_time TIME,
    end_time TIME
);

-- rota
CREATE TABLE rota (
    row_id INT PRIMARY KEY,
    rota_id VARCHAR(10),
    date DATE,
    shift_id VARCHAR(10),
    staff_id VARCHAR(10)
);

